Jums jābūt plānam, ko jūs ar to vēlaties sasniegt. Cik daudz jūs varat atļauties izmaksāt komisijās?<br/>
Vai tās būs pietiekoši pievilcīgas, salīdzinot ar jūsu konkurentiem?
Kā veicināt partneru piesaisti?',
'Review your settings'=>'Pārskatiet savus iestatījumus',
'Define your commissions'=>'Definējiet savas komisijas',
'GetStartedCommissions'=>'Viena vadošā kampaņa tiek izveidota instalācijas laikā. Jūs varat to modificēt vai radīt jaunas kampaņas.<br/><br/>
Kampaņas tiek izmantotas, lai grupētu produktu grupas (vai vienu produktu) kam ir identiski komisiju iestatījumi.<br/><br/>
Piemēram, jums var būt kampaņa Produktam1, kur jūs atalgojat partnerus par klikšķi, un cita kampaņa Produktam2, kur partneri saņem komisijas par pārdošanām.<br/><br/>
Vai arī, jums var būt kampaņa, kas saucas Zemo izmaksu produkti, kur jūs izmaksājat 40% no pārdošanas komisijās, un cita kampaņa, kas saucas Dārgo izmaksu produkti ar  15% par pārdošanu komisijās.',
'Add banners and other creatives'=>'Pievienot banerus un citus materiālus',
'GetStartedCreatives'=>'<strong>Baneru pārvaldniekā</strong>jūs atradīsiet dažādu veidu banerus, sākot ar teksta saitēm, standarta baneriem, kā arī  HTML, Flash un reklāmas e-pastu baneriem.<br/>
Katram banerim  jābūt savam URL - kurp tiks novirzīts apmeklētājs, kad tas uzies uz baneri.',
'Set up emails'=>'Uzstādīt e-pastus',
'Customize your affiliate signup form'=>'Pielāgojiet savām vajadzībām partneru reģistrācijas formu',
'GetStartedSignupForm'=>'Izvērtējiet standarta reģistrācijas veidlapu, un pielāgojiet to, ja tas nepieciešams.<br/><br/>
Reģistrācijas veidlapa tiek aprīkota ar mini-tīmekļa vietni, kura satur informāciju par partneru programmu utt.<br/>Jūs varat izmantot mini-tīmekļa vietni, vai arī izdzēst to un izmantot tikai reģistrācijas veidlapu.',
'Customize affiliate panel'=>'Pielāgot afilātes paneli',
'GetStartedIntegrate'=>'Integrācija ir veids, kādā partneru sistēma pieslēdzas jūsu patreizējai tīmekļa vietnei, pirkumu grozam vai maksājumu procesoram tā, lai afilāšu sistēma tiktu informēta par reģistrācijām un pirkumiem.<br/>
Kad saņem ziņu, partnerprogramma reģistrē pārdošanu, atrod partneri (ja tāds ir), kurš atbildīgs par pārdošanu un izveido attiecīgu komisiju viņam.<br/><br/>
Integrācija parasti nozīmē to, ka kodam jūsu lapās tiek pievienotas daļas rindas, un tas tiek aprakstīts soli pa solim Integrācijas instrukcijā, kur minētas plašāk pazīstamās maksājumu sistēmas un iepirkumu grozi. ',
'Test everything'=>'Pārbaudiet visu',
'GetStartedTest'=>'Kad esat nokonfigurējis kampaņas, komisijas un izvedojis banerus/saites, jums vajadzētu notestēt sistēmu.<br/>
Vislabākais ir simulēt visu procesu no partnera un sava redzes punkta:<ol>
<li>Piereģistrējieties, kā testa affiliate - pēc reģistrācijas jums vajadzētu saņemt apstiprnājuma e-pastu ar jūsu paroli, un jums būtu jāienāk sistēmā</li>
<li>Ienākot sistēmā, izvēlieties kādu no baneriem/saitēm un izvietojiet tos kādā no testa lapām. </li> 
<li>Spiediet uz baneri un pārliecinieties, ka klikšļis ir reģistrēts</li>
<li>Pēc klikšķa pamēģiniet veikt testa pārdošanu un pārliecinieties, ka pārdošanas komisija ir tikusi reģistrēta sistēmā (tas attiecas tikai uz pārdošanas vai piesaistīšanas komisijâm)</li>
</ol>
Ja jums rodas kādas problēmas kādā no soļiem, aktivizējiet<strong>Debug event logging</strong> un meklējiet<strong>Kļūdas iemeslu</strong>',
'Promote your affiliate program'=>'Reklamējiet savu partneru programmu',
'GetStartedPromote'=>'Kad esat pabeidzis(usi) izmēģināt afilāšu sistēmas integrāciju jūsu tīmekļa vietnē, viss ir gatavs, lai sāktu reklamēt savu jauno afilāšu programmu, lai piesaistītu jaunus partnerus.<br/><br/>
Obligāti neaizmirstiet pievienot saiti uz savu partnerprogrammas informāciju vai reģistrācijas formu savā mājas lapā. Nosauciet saiti Partnerprogramma vai tamlīdzīgi. Tas piesaistīs lietotājus jūsu tīmekļa vietnei, kuri vēlāk var kļūt par jūsu partneriem.<br/><br/>
Lai sasniegtu vairāk potenciālos partnerus, iesniedziet savu programmu specializētās partneru direktorijās. Internetā ir vairāki desmiti partneru direktoriju, kuras apmeklē tūkstoši pieredzējušu partneru katru dienu.',
